import React from "react";
import styled from "styled-components";

interface props {
  label: string;
  onClick?: () => void;
  //리턴문을 사용하지 않을 때 void
}

const Container = styled.button`
  cursor:pointer;
  color:#ff5722;
  background: #fff;
  border:none;
  padding: 8px 16px;
  border-radius:4px;
  &:hover {
    background: #ff5722;
    color: #fff;
    opaccity: 0.8;
  }
  &:avtive {
    box-shadow
  }
`

const Button = ({ label, onClick }: props) => {
  return <Container>{label}</Container>;
};

export default Button;
